import "./MiEspacio.css";
import 'bootstrap/dist/css/bootstrap.min.css';

import {Container, Row, Col} from 'react-bootstrap';


function MiEspacio() {
  return (
    <Container>
      <Row>
        <Col>1 of 2</Col>
        <Col>2 of 2</Col>
      </Row>
    </Container>
  )
}

export default MiEspacio;
